script: |
  super -f text -I q8535.spq | sort > q8535.out

inputs:
  - name: q8535.spq
    data: |
      SELECT + col0 FROM tab2 (FORMAT parquet) WHERE NOT + ( + + col1 ) + - col1 + - 2 BETWEEN ( - 88 * - ( - col2 ) ) AND 37 + - col0;
  - name: tab2

outputs:
  - name: q8535.out
    data: |
      46
      64
      75
